package primitivecasting;

public class Demo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10;
		double b = a;
		System.out.println(b);
		
		double c = 35;
		System.out.println(c);
		
		char x = 'a';
		int y = x;
		System.out.println(y);
		
		
		long i = 56432187432456l;
		int v = (int) i; 
		System.out.println(v);
		

	}

}
